void Game_over(struct Box boxlist[4],struct Hilight_area arealist[4],struct Game_status *Game){
  int count =0;
  for(int i=0;i<4;i++){
    for(int j=0; j<4; j++){
      if(boxlist[i].x==arealist[j].x && boxlist[i].y == arealist[j].y){
        count++;
      }
    }
  }
  if(count==4){
    Game->status =0;
  }
}

bool Game_restart(struct Game_status *Game){
  unsigned int edge_capture = *edge_cap;  // capture the edge_capture value
  *edge_cap = 0xffffffff;  // reset the edge_capture
  if(!Game->status && (edge_capture & 0x1)) {
    return 1;
  }
  return 0;
}

bool Game_replay(){
  unsigned int edge_capture = *edge_cap;  // capture the edge_capture value
  *edge_cap = 0xffffffff;  // reset the edge_capture
  if(edge_capture & 0x2) {
    return 1;
  }
  return 0;
}

